export const HOME_ROUTE = "/";
export const NEW_POST_ROUTE = "/posts/new";
export const POST_ROUTE = "/posts/:id";
export const EDIT_POST_ROUTE = "/posts/:id/edit";
export const DELETE_POST_ROUTE = "/posts/:id/delete";
export const CITY_ROUTE = "/city";
export const LOGIN_ROUTE = "/login";
export const REGISTER_ROUTE = "/register";

export default {
  HOME_ROUTE,
  NEW_POST_ROUTE,
  POST_ROUTE,
  EDIT_POST_ROUTE,
  DELETE_POST_ROUTE,
  CITY_ROUTE,
  LOGIN_ROUTE,
  REGISTER_ROUTE,
};
